import React from 'react';
import { ButtonGroup, ToggleButton } from 'react-bootstrap';

const ButtonOptions = ({text1, text2}) => {
  return (
    <ButtonGroup toggle>
      <ToggleButton type="radio" name="options" defaultChecked value="1">
        {text1}
      </ToggleButton>
      <ToggleButton type="radio" name="options" value="2">
        {text2}
      </ToggleButton>
    </ButtonGroup>
  );
};

export default ButtonOptions;
